import '../App.css'
import { Space, Button } from 'antd'

const MenuSet = ( { setClick } ) => {
    return (
        <div className='header'>
            <h1>某種標題</h1>
            <Space className='menu-set'>
                <Button onClick={()=>setClick(true)}>個股資訊</Button>
            </Space>
        </div>
    )

}

export default MenuSet
